// JavaScript CORS Proxy
// Save this in a file like cors.js and run with `node cors [port]`
// It will listen for your requests on the port you pass in command line or port 3000 by default
const port  = () => {
  let port = (process.argv.length > 2) ? parseInt (process.argv[2]) : 3000; // default
  require ('cors-anywhere').createServer ().listen (port, 'localhost')
}

export {port}
